import React from "react";
import Typed from "react-typed";

const HeroSection = () => {
  return (
    <div className="text-white flex flex-col w-full  h-screen max-w-[800px] justify-center mt-[-96px]  ">
      <p className=" font-bold text-1xl p-2 uppercase text-[#00df91]">
        Growing with Data Analytics
      </p>
      <h1 className="font-bold md:text-7xl sm:text-6xl  text-4xl md:py-6">
        Grow with data.
      </h1>
      <div>
        <p className="md:text-5xl sm:text-4xl text-xl font-bold">
          Fast,flexbile financing for{" "}
        </p>
        <Typed
          strings={["BTB", "BTC", "SASS"]}
          typeSpeed={120}
          backSpeed={140}
          loop
        />
      </div>
    </div>
  );
};

export default HeroSection;
